import React from "react";
import PostItem from "./PostItem";

function PostsList({ posts }) {
  return (
    <div>
      {posts &&
        posts.map((post) => {
          return <PostItem key={post.id} post={post} />;
        })}
    </div>
  );
}

export default PostsList;
